import{_ as t,o as a,c as n,z as e,a as o}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 46.2-634 Transfer of title when no qualification on estate.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/46.2-634.md","filePath":"vacode/46.2-634.md"}'),i={name:"vacode/46.2-634.md"},s=e("h1",{id:"§-46-2-634-transfer-of-title-when-no-qualification-on-estate",tabindex:"-1"},[o("§ 46.2-634 Transfer of title when no qualification on estate. "),e("a",{class:"header-anchor",href:"#§-46-2-634-transfer-of-title-when-no-qualification-on-estate","aria-label":'Permalink to "§ 46.2-634 Transfer of title when no qualification on estate."'},"​")],-1),r=e("p",null,"If the holder of a certificate of title is dead and there has been no qualification on his estate, a transfer may be made by a legatee or distributee if there is presented to the Department a statement made by a legatee or distributee to the effect that there has not been and there is not expected to be a qualification on the estate and that the decedent's debts have been paid or that the proceeds from the sale of the motor vehicle will be applied against his debts. The statement shall contain the name, residence at the time of death, date of death, and the names of any other persons having an interest in the motor vehicle which is sought to be transferred and, if these persons are of legal age, they shall signify in writing their consent to the transfer of the title.",-1),h=e("p",null,"Code 1950, § 46-90; 1958, c. 541, § 46.1-94; 1964, c. 574; 1972, c. 211; 1989, c. 727.",-1),c=[s,r,h];function d(l,f,m,p,_,u){return a(),n("div",null,c)}const v=t(i,[["render",d]]);export{g as __pageData,v as default};
